import React from 'react';
import "post.css";

export default function Post () {
    return (
        <div className="post">
            <img className="postImg" src="" alt="" />
            <div className="postInfo">
                <div className="postCats">
                    <span className="postCat">Malaysia</span>
                    <span className="postCat">Thailand</span>
                </div>
            </div>
        </div>
    );
}
